  `sno` int(5) NOT NULL AUTO_INCREMENT,
  `student_name` varchar(35) DEFAULT NULL,
  `roll` varchar(15) NOT NULL,
  `class` varchar(35) DEFAULT NULL,
  `section` varchar(15) DEFAULT NULL,
  `course` varchar(35) NOT NULL,
  `teacher` varchar(35) NOT NULL,
  `project_title` varchar(80) DEFAULT NULL,
  `assign_title` varchar(35) DEFAULT NULL,
  `assign_detail` varchar(300) DEFAULT NULL,
  `file_path` varchar(100) DEFAULT NULL,
  `file` blob,
  `approve` varchar(50) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `time` time DEFAULT NULL,
  PRIMARY KEY (`sno`,`roll`,`course`,`teacher`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

